import React, { useState } from "react";

export const Switcher = () => {

    let [value, setValue] = useState(false);

    return (
        <>
            {!value ? <button onClick={() => setValue(value)}>on</button> :
                 <button onClick={() => setValue(value)}>off</button>}

        </>
    )
}
